	/**
	 * Add all required keyObjects for RestrictedIdentification to the personalized object tree
	 * 
	 */
	protected void addRiKeys() {
		DomainParameterSet domainParameterSet;
		byte[] publicKeyMaterial;
		byte[] privateKeyMaterial;
		PublicKey publicKey;
		PrivateKey privateKey;
		KeyPair keyPair;

		// RI static key pair PICC
		domainParameterSet = StandardizedDomainParameters
				.getDomainParameterSetById(13);
		publicKeyMaterial = HexString
				.toByteArray("04 5D 3B 49 C8 EE 25 02 95 F7 C0 EF 6A 1A E8 10 C4 B9 E1 F5 F8 0D 31 6D C9 AD AD 16 08 0C 17 84 CF 88 1E E0 A3 75 BC A1 B5 3C 98 F3 AC39 FD 0C A9 0C E3 1D 2D 82 76 D3 CF B3 2B 31 6B A0 22 10 23 ");
		privateKeyMaterial = HexString
				.toByteArray("4E 0C 36 7E 36 CE 7E 8E 37 9E F5 AE 0C 88 59 C7 51 2D 8B EB 61 92 3F ED F7 F6 02 04 B1 95 8A 8C ");

		publicKey = domainParameterSet.reconstructPublicKey(publicKeyMaterial);
		privateKey = domainParameterSet
				.reconstructPrivateKey(privateKeyMaterial);
		keyPair = new KeyPair(publicKey, privateKey);

		KeyPairObject riKey = new KeyPairObject(keyPair, new KeyIdentifier(1));
		riKey.addOidIdentifier(new OidIdentifier(new RiOid(Ri.id_RI_ECDH_SHA_256)));
		mf.addChild(riKey);
	}

	
	/**
	 * Add all required keyObjects for ChipAuthentication to the personalized object tree
	 * 
	 */
	protected void addCaKeys() {
		// CA static key pair PICC
		DomainParameterSet domainParameterSet = StandardizedDomainParameters
				.getDomainParameterSetById(13);
		byte[] publicKeyMaterial = HexString
				.toByteArray("04 A4 4E BE 54 51 DF 7A AD B0 1E 45 9B 8C 92 8A 87 74 6A 57 92 7C 8C 28 A6 77 5C 97 A7 E1 FE 8D 9A 46 FF 4A 1C C7 E4 D1 38 9A EA 19 75 8E 4F 75 C2 8C 59 8F D7 34 AE BE B1 35 33 7C F9 5B E1 2E 94");
		byte[] privateKeyMaterial = HexString
				.toByteArray("79 84 67 4C F3 B3 A5 24 BF 92 9C E8 A6 7F CF 22 17 3D A0 BA D5 95 EE D6 DE B7 2D 22 C5 42 FA 9D");

		PublicKey publicKey = domainParameterSet
				.reconstructPublicKey(publicKeyMaterial);
		PrivateKey privateKey = domainParameterSet
				.reconstructPrivateKey(privateKeyMaterial);
		KeyPair keyPair = new KeyPair(publicKey, privateKey);

		KeyPairObject caKey = new KeyPairObject(keyPair, new KeyIdentifier(2));
		caKey.addOidIdentifier(Ca.OID_IDENTIFIER_id_CA_ECDH_AES_CBC_CMAC_128);
		mf.addChild(caKey);
	}

	/**
	 * Add domainparameters to the personalized object tree
	 * 
	 * @throws NoSuchAlgorithmException
	 * @throws NoSuchProviderException
	 * @throws IOException
	 * @throws UnsupportedEncodingException
	 */
	protected void addDomainParameters() {
		// create domain parameters
		DomainParameterSet domainParameterSet13 = StandardizedDomainParameters
				.getDomainParameterSetById(13);
		DomainParameterSetIdentifier domainParameterSetId13 = new DomainParameterSetIdentifier(
				13);
		DomainParameterSetCardObject domainParameterSetCardObject13 = new DomainParameterSetCardObject(
				domainParameterSet13, domainParameterSetId13);
		mf.addChild(domainParameterSetCardObject13);

		// register domain parameters for Pace
		domainParameterSetCardObject13
				.addOidIdentifier(Pace.OID_IDENTIFIER_id_PACE_ECDH_GM_AES_CBC_CMAC_128);
	}

